notes:
Os interessados em se conectar ao PIX Globo.com, devem manifestar seu interesse através do e-mail ptt-rj@corp.globo.com.

O email deve conter as seguintes informações:

- AS number;

- Se fala BGP;

- Possuir empresa constituída com situação fiscal regular;

- Anexar cópia simples do Contrato Social da empresa.

